import { ungzip } from "node-gzip";
const classModulesGZB64 = ``;
const classModulesStr = ungzip(Buffer.from(classModulesGZB64, "base64"));
export const classModules = classModulesStr.then(dcp => eval(dcp.toString("ascii")));

const classListGZB64 = ``;
const classListStr = ungzip(Buffer.from(classListGZB64, "base64"));
export const classList = classListStr.then(dcp => eval(dcp.toString("ascii")));
